import Foundation

enum TimeZoneEnum {
    case ALL, PST, MT, WNC, WSC, ENC, ESC, MA, SA, NE
    
    func getCode() -> String {
        switch self {
            case .ALL: return "ALL"
            case .PST: return "PST"
            case .MT: return "MT"
            case .WNC: return "WNC"
            case .WSC: return "WSC"
            case .ENC: return "ENC"
            case .ESC: return "ESC"
            case .MA: return "MA"
            case .SA: return "SA"
            case .NE: return "NE"
        }
    }
    
    func getName() -> String {
        switch self {
            case .ALL: return "All Regions"
            case .PST: return "Pacific"
            case .MT: return "Mountain"
            case .WNC: return "West North Central"
            case .WSC: return "West South Central"
            case .ENC: return "East North Central"
            case .ESC: return "East South Central"
            case .MA: return "Mid Atlantic"
            case .SA: return "South Atlantic"
            case .NE: return "New England"
        }
    }

    func getDescription() -> String {
        switch self {
        case .ALL: return "all 50 states."
        case .PST: return "\n\nAlaska, California, Hawaii, Oregon, and Washington"
        case .MT: return "\n\nArizona, Colorado, Idaho, Montana, Nevada, New Mexico, Utah, and Wyoming"
        case .WNC: return "\n\nIowa, Kansas, Minnesota, Missouri, Nebraska, North Dakota, and South Dakota"
        case .WSC: return "\n\nArkansas, Louisiana, Oklahoma, and Texas"
        case .ENC: return "\n\nIllinois, Indiana, Michigan, Ohio, and Wisconsin"
        case .ESC: return "\n\nAlabama, Kentucky, Mississippi, and Tennessee"
        case .MA: return "\n\nNew Jersey, New York, and Pennsylvania"
        case .SA: return "\n\nDelaware, Florida, Georgia, Maryland, North Carolina, South Carolina, Virginia, and West Virginia"
        case .NE: return "\n\nConnecticut, Maine, Massachusetts, New Hampshire, Rhode Island, and Vermont"
        }
    }
    
